import * as React from 'react'
import Typography from '@mui/material/Typography';
import { Grid } from '@mui/material';

function DailyList() {
    return(
        <Grid container justify="space-between">
            <Typography inline variant="body1" align="left" variant="h5">Medication</Typography>
            <Typography inline variant="body1" align="right" variant="h5">Doses</Typography>
        </Grid>
    );
}

export default DailyList;
